  return (
    <Flex w="100vw" minH={'100vh'} flexDir={"column"}  fontFamily={'Alata'} gap={3} background={'#F9FBF8'} overflow={'hidden'}>

      <Header />

      <Box flex={1}>
        <Outlet />
      </Box>

    </Flex>
  );
};

export default Root;
